import React from "react";
import Card from "./Card/Card";

function SearchList({filteresdUsers}){
    const filtered =filteresdUsers.map(user => <Card key={user.id} user={user}/>)
    return<div>SearchList
        {filtered}
    </div>
}
export default SearchList;
